import React from "react";

function BabyNamesList(props){
    return (
      <>
        {props.data.map((babyName) => (
          <div>
          {babyName.sex === "m"?
        <li className = "genderFormat" key={babyName.id}>
            {babyName.name}
          </li>:
          <li className = "genderFormat" key={babyName.id}>
            {babyName.name}
          </li>}
        </div>
        ))}
      </>
    );
}


export default BabyNamesList;
